import 'dart:convert';

import 'package:flutter/material.dart';
import 'package:flutter_widget/widget/widget.dart';

class ImagePage extends StatelessWidget {
  @override
  Widget build(BuildContext context) {
    return Myscaffold(
      title: 'Image',
      text: _text,
      code: _code,
      example: SingleChildScrollView(
        child: Column(
          children: <Widget>[
            Image.asset(
              'assets/images/img1.jpg',
              width: 200,
            ),
            Text("上面图片是用Image.asset实现，设置了width为200，height的值按照原来图片的比例自适应了"),
            Divider(),
            Image.network(
              'https://upload.jianshu.io/users/upload_avatars/18306372/1589e067-70c6-4acb-8ba0-b426bff0c3f2.jpg?imageMogr2/auto-orient/strip|imageView2/1/w/240/h/240',
              width: 100,
            ),
            Text("上面图片是用Image.network实现"),
            Divider(),
            ClipOval(
              child: Image.memory(base64.decode(_base64Image)),
            ),
            Text("上面图片是用Image.memory实现"),
          ],
        ),
      ),
    );
  }
}

final _text = '''Image：通过ImageProvider来加载图片
这是一个用来显示图片的Widget
Image.asset：用来加载本地资源图片，图片需要在pubspec.yaml添加下面代码：
  assets:
   - assets/images/img1.jpg
  注意上面代码需要缩进，一般是两个空格

Image.file：用来加载本地（File文件）图片，例如相册

Image.network：用来加载网络图片

Image.memory：用来加载Uint8List资源（byte数组）图片''';

final _code = '''Image({
    Key key,
    @required this.image,//图片来源
    this.semanticLabel,
    this.excludeFromSemantics = false,
    this.width,
    this.height,
    this.color,//颜色和图片混合
    this.colorBlendMode,//颜色和图片混合
    this.fit,//设置图片填充
    this.alignment = Alignment.center,//用来控制图片摆放的位置
    this.repeat = ImageRepeat.noRepeat,//用来设置图片重复显示
    this.centerSlice,
    this.matchTextDirection = false,
    this.gaplessPlayback = false,
    this.filterQuality = FilterQuality.low,
  })
fit属性可以设置的值
BoxFit.contain
全图居中显示但不充满，显示原比例

BoxFit.cover
图片可能拉伸，也可能裁剪，但是充满容器

BoxFit.fill
全图显示且填充满，图片可能会拉伸

BoxFit.fitHeight
图片可能拉伸，可能裁剪，高度充满

BoxFit.fitWidth
图片可能拉伸，可能裁剪，宽度充满

BoxFit.scaleDown
效果和contain差不多， 但是只能缩小图片，不能放大图片 ''';

final String _base64Image =
    '';
